import React from "react";
import styles from "./myEvents.module.css";

const MyEvents = () => {
  return (
    <>
      <Header />
      <div className={styles.eventPageWrapper}>
        <h1 className={styles.eventsH1}>Manage Events</h1>
      </div>
    </>
  );
};

export default MyEvents;
